<span class="line"><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">branch.&lt;branchname&gt;.merge</span><span style="color:#89DDFF;">&#39;</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">in</span><span style="color:#A6ACCD;"> your configuration file.</span></span>
